import React from 'react'
import { Col, Container, Row } from 'reactstrap'
import { TypeAnimation } from 'react-type-animation';

const Header = () => {
    return (
        <div>
            <div className='pt-5 mt-5'></div>
            <Container>
                <Row>
                    <Col md="8">
                        <h4 className='text-blue'>hi, i'm sayed osama</h4>
                        <span cla
                        text-blue>i'm</span>
                        <TypeAnimation
                        sequence={[
                            'i\'m',
                            1000,
                            'Front End Developer',
                            2000,
                            'i\'m Front End Developer',
                            () => {
                                console.log('Sequence completed');
                            },
                        ]}
                        wrapper="h2"
                        cursor={true}
                        repeat={Infinity}
                        style={{ fontSize: '4em', display: 'inline-block', color: '#fff' }}
                        />
                    </Col>

                    <Col md="4">
                        <img className='img-fluid rounded' src='images/my-photo.jpeg' alt='my-img' />
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Header
